import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <Switch>
          <Route exact path="/" component= {Home} />
          <Route exact path="/join" component = {Join}/>
          <Route exact path="/lobby/:id" component = {Lobby}/>
          <Route exact path="/game/:id" component = {Game}/>
      </Switch>
  </Router>
  )
}

export default App;
